import React from "react";
import {BrowserRouter,Route,Routes} from "react-router-dom";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import HomeComponent from "./pages/HomeComponent";
import Dashboard from "./pages/Dashboard";
import Language from "./Pro/Language";
import L2 from "./Pro/L2";
import L4 from "./Pro/L4";
import L5 from "./Pro/L5";
import Quiz3 from "./Pro/Quiz3";
import IntroComponent from "./Pro/IntroComponent";

const App=()=>{
    return(
    <div>
        <BrowserRouter>
            <Routes>
                <Route path="/" exact element={<HomeComponent />}/>
                <Route path="/register" exact element={<Signup />}/>
                <Route path="/login" exact element={<Login />}/>
                <Route path="/course" exact element={<Language/>} />
                <Route path="/level1" exact element={<IntroComponent/>} />
                <Route path="/level2" exact element={<L2/>} />
                <Route path="/level3" exact element={<Quiz3/>} />
                <Route path="/level4" exact element={<L4/>} />
                <Route path="/level5" exact element={<L5/>} />
                {/* <Route path="/level6" exact element={<L6/>} /> */}
                {/* <Route path="/level7" exact element={<L7/>} /> */}
                {/* <Route path="/level8" exact element={<L8/>} />
                <Route path="/level9" exact element={<L9/>} />
                <Route path="/level10" exact element={<L10/>} /> */}
            </Routes>
        </BrowserRouter>
    </div>
    );
}

export default App;
